#include <iostream>
#include <vector>
using namespace std;

class Solution
{
public:
	int minKBitFlips(vector<int>& nums, int k)
	{
		int flips = 0;
		int size = nums.size();
		//cout << "size is : " << size << endl;

		for (int i = 0; i < size; i++)
			if (nums[i] == 0)
			{
				// k window vs remaining size check
				if (i + k > size)
					return -1;
				// flip
				for (int j = i; j < k + i; j++)
					nums[j] = !nums[j];
				flips++;
			}

		return flips;
	}
};

